; (function ($) {
    $.fn.lazyload = function (settings) {
        var $this = $(this)
            , _winScrollTop = 0
            , _winHeight = $(window).height();
        settings = $.extend({
            selector: 'lazy',
            resetHeight: true,
            container: 'window',
            threshold: 180,
            //placeholder: 'data:image/gif;base64,'
            placeholder: 'data:image/png;base64,'
        }, settings || {});
        lazyload();
        $(settings.container).on('scroll', function () {
            lazyload();
            _winScrollTop = $(this).scrollTop();
        });
        function lazyload() {
            $this.each(function () {
                var $self = $(this);
                if (!$self.hasClass(settings.selector)) { return; }
                var _offsetTop = $self.offset().top;
                if ($self.is('img')) {
                    if ($self.data('original')) {
                        if ($self.attr('src') == '') {
                            $self.attr('src', settings.placeholder);
                        }
                        //if ((_offsetTop - settings.threshold) <= (_winHeight + _winScrollTop)) {
                        if ((_offsetTop - settings.threshold) <= _winHeight) {
                            var imgUrl = $self.attr('data-original');
                            $self.removeAttr('data-original', '').removeClass(settings.selector);
                            loadImage(imgUrl, function () {
                                $self.css('opacity', 0).attr('src', imgUrl);
                                $self.animate({
                                    'opacity': 1
                                }, 660);
                            });
                        }
                    }
                } else {
                    if ($self.data('original')) {
                        if ($self.css('background-image') == 'none') {
                            $self.css('background-image', 'url(' + settings.placeholder + ')');
                        }
                        if ((_offsetTop - settings.threshold) <= _winHeight) {
                            var imgUrl = $self.attr('data-original');
                            $self.removeAttr('data-original', '').removeClass(settings.selector);
                            loadImage(imgUrl, function () {
                                $self.css('opacity', 0).css('background-image', 'url(' + imgUrl + ')');
                                $self.animate({
                                    'opacity': 1
                                }, 660);
                            });
                        }
                    }
                }
                if (settings.resetHeight && $self.height() != $self.width()) {
                    $self.height($self.width());  //动态设置图片高宽为（方图）
                }
            });
        };
        function loadImage(url, callback) {
            var img = new Image(); //创建一个Image对象，实现图片的预下载
            img.src = url;

            if (img.complete) { // 如果图片已经存在于浏览器缓存，直接调用回调函数
                callback.call(img);
                return; // 直接返回，不用再处理onload事件
            }
            img.onload = function () { //图片下载完毕时异步调用callback函数。
                callback.call(img);//将回调函数的this替换为Image对象
            };
        };
    }
})(Zepto);
